export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o){return {data:{qDF5GyFA2r:{data:{id:137,attributes:{imdbId:"tt1440728",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjAxMDg1NDcxM15BMl5BanBnXkFtZTcwODc3MDg1Mw@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"66%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:800,attributes:{title:c,plot:"Alone among assassins, Jack is a master craftsman. When a job in Sweden ends more harshly than expected for this American abroad, he vows to his contact Pavel that his next assignment will be his last. Jack reports to the Italian countryside, where he holes up in a small town and relishes being away from death for a spell. The assignment, as specified by a Belgian woman, Mathilde, is in the offing as a weapon is constructed. Surprising himself, Jack seeks out the friendship of local priest Father Benedetto and pursues romance with local woman Clara. But by stepping out of the shadows, Jack may be tempting fate.",slug:"the-american"}}},books:{data:[{id:2294,attributes:{title:d,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:i,subtitle:j}},{id:2295,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:b,published:m,publisher:n,subtitle:o}},{id:2296,attributes:{title:d,description:f,thumbnail:g,authors:[a],firstBook:b,published:h,publisher:i,subtitle:j}},{id:2297,attributes:{title:d,description:e,thumbnail:e,authors:[a],firstBook:b,published:"1992-02-06",publisher:"Vintage",subtitle:e}},{id:2298,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:b,published:m,publisher:n,subtitle:o}}]}}},meta:{}}},prerenderedAt:1680940911895}}("Martin Booth",null,"The American","A Very Private Gentleman","","The locals in the southern Italian town where he lives call him Signor Farfalla--Mr. Butterfly: for he is a discreet gentleman who paints rare butterflies. His life is inconspicuous--mornings spent brushing at a canvas, afternoons idling in the cafes, and evening talks with his friend the town priest over a glass of brandy. Yet there are other sides to this gentleman's life: Clara: the young student who moonlights in the town bordello. And another woman who arrives with $100,000 and a commission, but not for a painting of butterflies. With this assignment returns the dark fear that has dogged Signor Farfalla's mysterious life. Almost instantly, he senses a deadly circle closing in on him, one which he may or may not elude. Part thriller, part character study, part drama of deceit and self-betrayal, A Very Private Gentleman shows Martin Booth at the very height of his powers","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZmA_SplJL6wC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2005-02-01","Macmillan","A Novel","The locals in the southern Italian town where he lives call him Signor Farfalla--Mr. Butterfly: for he is a discreet gentleman who paints rare butterflies. His life is inconspicuous--mornings spent brushing at a canvas, afternoons idling in the cafes, and evening talks with his friend the town priest over a glass of brandy. Yet there are other sides to this gentleman's life: Clara: the young student who moonlights in the town bordello. And another woman who arrives with $100,000 and a commission, but not for a painting of butterflies. With this assignment returns the dark fear that has dogged Signor Farfalla's mysterious life. Almost instantly, he senses a deadly circle closing in on him, one which he may or may not elude. Part thriller, part character study, part drama of deceit and self-betrayal, The American (A Very Private Gentleman) shows Martin Booth at the very height of his powers.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=h8bNYcNwWgMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2010-09-10","Picador","(A Very Private Gentleman)"))